import './App.css';
import Logo from './images/logo.png'
import Menu from './images/menu.svg'


function App() {
    return (
        <div className="App">
            <header className='header'>
                <div className='container'>
                    <nav className='header-nav'>
                        <img className='logo-img' src={Logo} alt="Лого" width="82" height="101"/>
                        <ul className='nav-links'>
                            <li className='nav-item'>ГЛАВНОЕ</li>
                            <li className='nav-item'>ИНФОРМАЦИЯ</li>
                            <li className='nav-item'>О НАС</li>
                        </ul>
                        <img className='menu-img' src={Menu} alt='меню' width="102" height="50"/>
                    </nav>
                </div>
            </header>
        </div>
    );
}

export default App;
